B.GN=new A.cG("Flutter \u2014 Portfolio","I built this website with Flutter web to showcase my projects! It is the first website I've built with Flutter after the stable release of Flutter web. I've built couple CMS websites to mobile apps with the earlier versions of Flutter, but the performance of Flutter web kept dissappointing. I've gotta say, they've really upped their game since then. I'm very pleased with it now!",null,"June 2022","Personal project","https://github.com/O-Hannonen/portfolio.git",B.bm,B.ao)
B.b_=new A.xo(1,"right")
B.GL=new A.cG("Flutter \u2014 Template",'The template is my first "boilerplate" project. It was made to speed up the process of creating new flutter apps. It contains loads of boilerplate code, that can be reused from app to app. \n    \nThe template has lots of stuff preconfigured, such as authentication, localizations, permission handling, linting, haptics, routing, logging, and dynamic theming. It also contains boilerplate code for many of the firebase services. Note: this app is still a work in progress (especially the documentation/"how to use" section).',null,"March 2022","Personal project","https://github.com/O-Hannonen/template",B.b_,B.ao)
B.GP=new A.cG("Flutter \u2014 Mapventure","I developed and maintained the Mapventure app as part of a small team. At first I was the only programmer working on the app, but after six months the team grew and I got myself a programming pair.\n\nThe job was diverse and instructive. Mapventure was by its nature a perfect starter project for my career. At first none of us really knew what Mapventure is or could be. Therefore we developed and tested a ton of different versions of the app. That allowed me to learn and get my hands dirty with lots of different aspects of mobile development. During the project, I've worked with authentication, geolocation, maps, audio files, localizations, qr-codes, in app purchases + subscriptions, push notifications, dynamic links, phone sensors, analytics tools, databases and plenty of more!","assets/mapventure.png","April 2020 - July 2021","And Now For Something Completely Different Oy","https://www.mapventure.com",B.bm,B.ao)
B.GQ=new A.cG("React \u2014 Tic-tac-toe","Tic-tac-toe was the first react website I've built. The whole purpose of the website was to start getting familiar with react. The game works like a charm, even though the code may look ugly for anyone more experienced with react.","assets/tic-tac-toe.png","December 2021","Personal project","https://github.com/O-Hannonen/tic-tac-toe",B.b_,B.de)
B.GS=new A.cG("Flutter \u2014 Statusbarz","Statusbarz is my first open source contribution to the flutter community.\n\nAs most of the packages on pub.dev, Statusbarz was birthed to solve a problem in an app we were developing; We needed to change the phones statusbar color depending on the background image, so that the text on the statusbar is always visible. The problem was that the image came from the network, so we did not know if it was light or dark, and we did not want to use gradients on top of the image. So, we made a package that reads the pixels from statusbars background, calculates their average color and changes statusbar color based on it.",null,"June 2021","Open source contribution","https://pub.dev/packages/statusbarz",B.b_,B.ao)
B.GH=new A.cG("Flutter \u2014 The launcher","The launcher was my upper secondary schools final assignment. The app was an Android launcher, which was supposed to make everyday tasks faster and easier (but then I switched to IOS as my operating system of choice :D).\n\nThe launcher really does have some nice features. The launcher can start all the apps installed on the phone, do some calculations, make phone calls straight from the home screen, control your smart home (lights, TV, etc.), see the current weather, see the local covid stats, see the school lunch menu and read the latest news.","assets/the-launcher.png","February 2021","ICT upper secondary school final assignment","https://github.com/O-Hannonen/thelauncher",B.b_,B.de)
B.GO=new A.cG("HTML + CSS \u2014 Neumorphism","Neumorphism was my web development courses final assignment at Kerttuli ICT upper secondary school.\n\nIt was a dead simple HTML + CSS website to showcase neumorphic design pattern.","assets/neumorphism.png","April 2020","Web development course final assignment","https://github.com/O-Hannonen/neumorphism.git",B.bm,B.ao)
B.GK=new A.cG("Flutter \u2014 Verbal clock","Verbal clock was my entry for the flutter clock competition hosted by google.\n\nIt was one of my first Flutter projects ever (thats pretty obvious when looking at the code :D). It was a really fun way to learn by doing, and I even managed to make my crazy clock idea work. The clock actually looks surprisingly good and works really well!","assets/flutter_clock.png","January 2020","Competition entry","https://github.com/O-Hannonen/flutter_clock",B.bm,B.ao)
B.GT=new A.cG("Unity + Arduino \u2014 Quiz game","I built a quiz game that was on display at an exhibition.\n\nThe game itself was built with Unity, and the buttons that controlled the game were built with Arduino.",null,"October 2019","Verstas Helsinki Oy",null,B.b_,B.ao)
B.GJ=new A.cG("Python \u2014 Automations",'I built and programmed automations for an "escape room" that was on display at Ruisrock 2019.\n\nThe room was part of a launch of Sisus new product. The automations were about controlling lights, playing audios and opening doors based the data of different sensors. The code was written in python, and it was running on raspberry PIs which were hooked to all of the other electronics.',null,"June 2019 - July 2019","Verstas Helsinki Oy",null,B.b_,B.ao)
B.GI=new A.cG("Unity \u2014 Energy hackathon","I took part in an energy themed hackathon with couple of my friends.\n\nDuring the couple days, we made a demo of a Sims -like 3D game. The idea behind the game was to teach players about energy efficient and sustainable living. We ended up getting a honorary award and bunch of free laptops for our efforts.",null,"May 2019","Hackathon","https://energiaviisaat.fi/energyhackathon/",B.bm,B.ao)
B.GR=new A.cG("Unity \u2014 Wilmaten","Wilmaten is a practical game for learnign to type fast on computer.\n\nIt was my entry for a game development competition hosted by Visma. The game ended up being the audience favourite, and I got myself a summer job as a trainee at Visma. As a trainee, my job was to further develop Wilmaten, so that it could be used for marketing. During the two week trainee program, I turned the demo into an online multiplayer game with multiple different game modes. I also learned to use GIT, and got a ton of useful tips and career advice from the Wilma team.","assets/wilmaten.png","January 2019","Visma Oy","https://github.com/O-Hannonen/wilmaten",B.b_,B.de)
B.GM=new A.cG("Flutter \u2014 Dinera","Dinera was the first flutter app I've ever built. It was a fully functioning social networking app for sharing recipes.\n\nThe app allowed users to share their recipes, follow their friends and interact with their recipes. Dinera was the project I used to initially learn Flutter with. It was a long project, that I developed whenever I had some spare time. As I learned new stuff, I kept updating and improving the app. The app was developed to the point that it could have been published (altough it would have been buggy and the code was really messy).",null,"December 2018 - April 2020","Personal project",null,B.bm,B.ao)
